import { useParams } from "react-router-dom";
import { Asking } from "./asking";
import { Askingcontent } from "./askingcontent";
import { Hearing } from "./hearing";
import { Home } from "./home";
import { Mychild } from "./mychild";



export function Content() {
    const theThing = useParams().thething
    return <div>

        <div>
            {theThing === 'Ask' && < Askingcontent />}
        </div>

        <div>
            {theThing === 'hearing' && <Hearing />}
        </div>

        <div>
            {theThing === 'mychild' && <Mychild />}
        </div>
        <div>
            {theThing === 'Home' && <Home />}
        </div>


    </div>;
}
